import React from 'react';
import "../styles/card.css";

function clicked(isClicked) {
    if( !isClicked ) {
        return true
    } 
}


function Card(props) {


    return (
        <div className="col-3">
            <div className="tile mb-3">
                <img 
                    className="tile-image" 
                    src={props.src} 
                    data-id={props.id} 
                    alt={props.alt} 
                    data-isClicked={clicked(props.isClicked)}
                    onClick={ (e) => {


                        props.handleIncrement(props.isClicked)

                    }} />

            </div>
        </div>
    );
  }

  export default Card;
